		title = f2_arg1.contextualMenuTitle,
		showRankInfo = f2_arg1.showRankInfo
	} )
	f2_arg0:AddContextualMenuAction( {
		id = "leaveParty",
		actionName = Engine[0xED84C33EC5F01EA]( 0xEC125040F4F4C6D ),
		actionFunction = function ()
			PARTY.LeaveParty( f2_arg0, f2_arg0._controllerIndex, Social[0x446FFD0DEAD15E3]() )
		end,
		conditionFunction = function ()
			return PARTY.CanLeaveParty( Social[0x446FFD0DEAD15E3]() )
		end
	} )
	f2_arg0:AddContextualMenuAction( {
		id = "inviteParty",
		actionName = Engine[0xED84C33EC5F01EA]( 0x2F942D694434FFA ),
		actionFunction = function ()
			SOCIAL.OpenQuickInvitesPopup( f2_arg0._controllerIndex, LUI.SocialQuickInvitesPopup.MenuIds.PARTY_INVITE, {} )
		end
	} )
	f2_arg0:AddContextualMenuAction( {
		id = "addFriend",
		actionName = Engine[0xED84C33EC5F01EA]( 0xBBEE4D286593A5D ),
		actionFunction = function ()
			LUI.FlowManager.RequestAddMenu( "SocialAddFriendsOverlay", true, f2_arg0._controllerIndex )
		end
	} )
	if CONDITIONS.InFrontend() and SHOWCASE.IsShowcaseEnabled() then
		f2_arg0:AddContextualMenuAction( {
			id = "viewProfile",
			actionName = Engine[0xED84C33EC5F01EA]( 0xB81325BA15D0C76 ),
			actionFunction = function ()
				LUI.FlowManager.RequestAddMenu( "SocialProfileMenu", true, f2_arg0._controllerIndex, false, {
					showEnhancedDetails = true,
					socialProfileTabId = FRIENDS.SocialProfileTabIDs.DETAILS,
					playerData = PlayercardUtils.PlayerDataFromDataSource( f2_arg0._controllerIndex )
				}, true )
			end
		} )
	end
	f2_arg0:AddContextualMenuAction( {
		id = "reportPlayer",
		actionName = Engine[0xED84C33EC5F01EA]( 0x83581AB5B0DB4DC ),
		actionFunction = function ()
			if CONDITIONS.IsSplitScreenMenuInUse() then
				return 
			else
				ACTIONS.OpenMenu( "ReportPlayerSelectMenu", true, f2_arg0._controllerIndex )
			end
		end
	} )
end

